<html lang=""en"">
<head>

    <title>Unlock Your Key</title>
    <style>
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            background: linear-gradient(135deg, #1a1a1a, #333333); /* Gradiente oscuro */
            color: white;
            text-align: center;
        }

        .container {
            background-color: rgba(255, 255, 255, 0.05); /* Contenedor casi transparente */
            padding: 40px;
            border-radius: 15px;
            box-shadow: 0 8px 20px rgba(0, 0, 0, 0.5); /* Sombra más oscura */
            backdrop-filter: blur(10px);
            border: 1px solid rgba(255, 255, 255, 0.1); /* Borde sutil */
        }

        button {
            padding: 15px 30px;
            margin: 10px;
            border: none;
            border-radius: 8px;
            background: linear-gradient(to right, #444444, #666666); /* Gradiente gris */
            color: white;
            font-size: 16px;
            cursor: pointer;
            transition: transform 0.2s ease, box-shadow 0.2s ease;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.4); /* Sombra más oscura */
        }

        button:hover {
            transform: translateY(-3px);
            box-shadow: 0 6px 12px rgba(0, 0, 0, 0.5); /* Sombra más oscura */
            background: linear-gradient(to right, #666666, #888888); /* Gradiente gris más claro al pasar el ratón */
        }

        #keyText {
            display: none;
            margin-top: 20px;
            font-size: 18px;
            padding: 15px;
            background-color: rgba(255, 255, 255, 0.1); /* Fondo casi transparente */
            border-radius: 8px;
            transition: opacity 0.3s ease;
            border: 1px solid rgba(255, 255, 255, 0.1); /* Borde sutil */
        }

        #keyText.show {
            display: block;
            opacity: 1;
        }
    </style>
